import React from "react";

function CreateTicket() {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <i class="fa fa-plus-circle" aria-hidden="true"></i>
          Account Opening
        </div>
        <div className="col">
          <i class="fa fa-user" aria-hidden="true"></i>
          Your Zerodha Account
        </div>
        <div className="col">
          <i class="fa fa-plus-circle" aria-hidden="true"></i>
          Your Zerodha Account
        </div>
      </div>
    </div>
  );
}

export default CreateTicket;
